המבקש:                     עו"ד מיכאל
בך; עו"ד רון לדרמן;

בקשת רשות ערעור על
  פסק דינו של בית המשפט המחוזי בחיפה ב-עפ"א 19408-01-21 מיום 18.5.2021
  שניתן על ידי השופטת א' דגן;

בקשה לעיון בתיק
  בית משפט; תשובת המשיבים 3-2 מיום 1.8.2021; תשובת המשיב 1 מיום 15.8.2021;
  תשובת העותרת מיום 30.8.2021

(1) 
ועדה מקומית, או מהנדס ועדה מקומית, שמרחב התכנון שלה כלול בתחום התכנית או
גובל אותו;

(2) 
רשות מקומית, לרבות ועד מקומי כאמור בסעיף 3 לפקודת המועצות המקומיות, שאזור
שיפוטה כלול בתחום התכנית או גובל אותו;

(3) 
גוף ציבורי או מקצועי שאושר לכך בדרך כלל על ידי שר הפנים בצו ברשומות ושיש
לו ענין ציבורי בתכנית;
